          "Welcome to Water’s Reach, a charming single-storey lodge with 3 bedrooms nestled just 0.4 miles from Troutbeck Bridge and moments from the serene shores of Lake Windermere. Surrounded by the natural beauty of the Lake District, this peaceful hideaway offers a perfect escape for families, friends, and well-behaved pets (up to 2 welcome!).\n\nSleeps 6 but maximum of 4 adults only | 3 Bedrooms\n\n1 king-size bedroom with en-suite WC and basin\n\n2 twin bedrooms – perfect for children or friends\n\nA sleek family shower room with walk-in shower, basin, and WC\n\nComfort Meets Style\nRelax in the spacious open-plan living area, complete with a Smart TV and a cosy electric fire—perfect for unwinding after a day of exploration.\n\nFully Equipped Kitchen\nWhip up your favourite meals with ease in the well-appointed kitchen featuring an electric oven, gas hob, microwave, dishwasher, wine chiller, and fridge/freezer.\n\nDining for 6\nGather around the dining table to share a meal, plan your next adventure, or simply enjoy quality time together.\n\nOutdoor Living\nStep outside to your private decking and patio area, ideal for morning coffee or evening drinks. Outdoor furniture lets you soak in the tranquil surroundings in comfort.\n\nConvenience & Extras\n\nOff-road parking for 2 vehicles\n\nPet-friendly for up to 2 dogs\n\nWi-Fi, heating, and all essentials provided\n\nUnbeatable Location\nExplore the best of the Lake District:\n\nNational Trust – Wray Castle & woodland walks\n\nBrockhole on Windermere: zip lines, boat hire & trails\n\nOrrest Head Viewpoint for stunning panoramas\n\nZip World Windermere for adrenaline-filled fun\n\nHistoric excursions: Lancaster Castle, Kendal Museum, and more\n\nAfter a day of adventure or relaxation, return to the serene comfort of Water’s Reach—your perfect Lake District retreat.",
